import React from 'react';
import { Box, Image, Button, Heading } from '@chakra-ui/react'
import logo from '../images/logo.png'; // with import
// import { StarIcon } from '@chakra-ui/icons'
// // Sample card from Airbnb

function NavBar() {
    return (
      <Box
        bg='pink' 
        w='100%'
      >
        <Image width="100px" height="100px" src={logo} alt="test" />
        <Heading as='h1' size='2xl' isTruncated>
            IOU
        </Heading>
        <Button>Hey</Button>
      </Box>
    );
  }

export default NavBar;
